import React from 'react';
import { Box } from '@mui/material';
import  { Routes, Route } from 'react-router-dom';
import { Main, Channel } from '../index'

const App = () => {
return (
    <div>
        <Box>
            <Routes>
                <Route path='/' element={<Main />} />
            </Routes>
        </Box>      
    </div>
)
}

export default App
